{"carousel_items": [{"link_page": null, "embed_url": "", "description": "Learn more about the Xanana Gusmão Reading Room", "image": 51, "link_external": "", "caption": "About Us", "sort_order": 0, "link_document": null, "pk": 1, "button_link": "", "page": 4}], "search_description": "", "owner": 2, "intro": "<p>The Xanana Gusmão Reading Room (XGRR) is a non-governmental organisation that consists of a library, museum and general community space (all free to visit) in the heart of Dili. Our facilities include free to use computers and internet, an extensive collection of books and visual/audio materials (over 4000), an online catalogue, museum exhibitions, a children's area and various bookable community areas. We keep our vision, mission and values central to everything that we do.</p>", "latest_revision_created_at": "2017-04-25T07:30:01.271Z", "go_live_at": null, "title": "About", "seo_title": "About", "slug": "about", "live": true, "has_unpublished_changes": false, "body": "<h2>Our Mission, Vision and Values</h2><p><br/></p><p><b>Our Vision</b>: Create the reading generation in Timor-Leste.</p><p><b>Our Mission</b>: To provide dynamic spaces for all people to access information and resources to improve their lives.</p><p><b>Our Values</b>: Respect, Integrity, Quality, Community, Inclusivity. </p><h2>History of Xanana Gusmao Reading Room</h2><p>The Xanana
Gusmão Reading Room (XGRR) was established in June 2000 to serve as a safe place where
children, youth, students, and the public at large, could access books and resources
with a view to fostering a love of reading within the community. Since then,
the XGRR has
contributed significantly to library development in Timor-Leste and has hosted
a range of
educational and other activities aimed at nurturing pride in East Timorese
culture and
promoting skills development.</p>

<p>The Reading
Room was established by Kirsty Sword Gusmão, the wife of Timor-Leste’s
first post-independence President Xanana Gusmão. As founder and patron, Mrs
Gusmão has been involved in its operation ever since it opened.<br/>  <br/>This
complex houses loads of memorabilia from Xanana Gusmão, and there is a library, bookshop, exhibition space, audio visual area and internet available. Artwork on display includes those
Xanana Gusmão painted while imprisoned in Jakarta.</p><h2><b>Board of Governors </b></h2><p>It is the
Boards' responsibility to ensure that the Coordinator is doing his job well and
that the XGRR is not at risk. Regular board meetings are held, board members
participate in events and fundraising. The board members are as follows:</p><p>Patron/Chair:
Kirsty Sword Gusmao</p><p>Deputy of
Chair: Joào Martires<br/></p><p>Members:<br/></p><ul><li>Sebastian da Silva<br/></li><li>Mara Bernades de Sa<br/></li><li>Francisca Maia<br/></li><li>Palmira Pires<br/></li><li>Maria Isabel de Jesus Ximenes<br/></li><li>Jenny Coles<br/></li><li>Sandi Paul<br/></li><li>Bernabe (Abe) Barreto<br/></li></ul>Advisers<br/><ul><li>Del Bovill<br/></li><li>Anya Dettman. National Library of
Australia<br/></li><li>Ina Fautua. New Zealand Embassy, Papua
New Guinea     <br/></li><li>Patti Manolis. CEO Geelong Libraries,
Australia <br/></li></ul><p></p><h2>Staff Directory</h2><p>Our staff is dedicated, wonderful and will be helpful when you visit the Reading Room. We love visitors. We look forward to hosting you. Our team members are as follows:</p><p>Permanent
Staff:</p><p></p><ul><li>Gaspar Freitas, Manager<br/></li><li>Domingos Pereira, Team Leader –
Library and Museum<br/></li><li>Maria Amaral Guteeres, Scholarship
Program Administrator<br/></li><li>Arsenio da Costa, Digital Library
Assistant<br/></li><li>Felizarda Tilman, Finance and HR Assistant</li></ul>Temporary
Volunteers:<p></p><p>National</p><p></p><ul><li>Jose Paul<br/></li><li>Inacio</li><li>….. </li></ul><p></p><p>International</p><p></p><ul><li>Sam Knowles (UniVol – VSA)<br/></li></ul><p></p>
